import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="flex no-scrollbar">
      <div className="flex flex-row h-24 w-full items-center justify-end gap-10 mx-10 ">
        <div>
        </div>
        <div>
          <Link to="/">Home</Link>
        </div>
        <div>
          <Link to="/admin/upload">Upload</Link>
        </div>
        <div>
          <Link to="/admin-page">Listings</Link>
        </div>
      </div>
    </div>
  );
};

export default NavBar;
